/*
 If youâ€™re not familiar with decorators (the @connector section here),
 then itâ€™s easiest to think of them as a replacement for what you would used to use a â€˜mixinâ€™ for.
 You may have actually seen them in other languages, like Python, for instance.
 If not, in Javascript they are just functions that modify another given function (here a â€˜classâ€™) in some way.
 Notice how when defined like this (â€˜class leadingâ€™) they are attached to the following class definition,
 hence the lack of ;.
 Reduxâ€™s @connect decorator wraps our class in another component ( <Connector>),
 giving it access to the requested parts of state as props, hence why we can use todos as we do.
 It also passes in Reduxâ€™s dispatch function which can be used to dispatch actions like so: dispatch(actionCreator());
 */

class Home extends Component {
  static propTypes = {
    todos:    PropTypes.any.isRequired,
    dispatch: PropTypes.func.isRequired
  };

  static needs = [
    TodoActions.getTodos
  ];

  render() {
    const { todos, dispatch } = this.props;

    /*
     Finally we use reduxâ€™s bindActionCreators method to pass inâ€¦ ermmâ€¦ bound action creators.
     What this means is that, in the child components, we can just call the action creators directly,
     without wrapping them in a dispatch() call as above.
     */
    return (
      <div id="todo-list">

        <TodosView todos={todos}
           {...bindActionCreators(TodoActions, dispatch)} />

        <TodosForm
          {...bindActionCreators(TodoActions, dispatch)} />
      </div>
    );
  }
}

export default connect(state => ({ todos: state.todos }))(Home)

